var meas_name = 'flood-sensor';
var app_name = 'cm-test-app';
var field_name = 'dist_mm';

var agg_str = 'median';

var query = 
`
import "date"
data = from(bucket: "${bucket_name}")
  |> range(start: ${st_ts.getTime() / 1000}, stop:${en_ts.getTime() / 1000})
  |> filter(fn: (r) => r._measurement == "${meas_name}")
  |> filter(fn: (r) => r.app_name == "${app_name}")
  |> filter(fn: (r) => r._field == "${field_name}")
  |> filter(fn: (r) => {
    hour = date.hour(t: r._time)
    return hour >= ${st_hour_utc} and hour < ${en_hour_utc}
  })
  |> keep(columns: ["_value", "dev_id"])
  |> group(columns: ["dev_id"])

std_var = data |> stddev()
med_var = data |> ${agg_str}()
join(tables: {stddev: std_var, ${agg_str}: med_var}, on: ["dev_id"])
|> rename(columns: {_value_median: "${agg_str}", _value_stddev: "stddev"})
|> filter(fn: (r) =>
    r.stddev < ${std_limit}
  )
`
msg.query = query;

return msg;

